import sliderImg01 from "../../Multi/slider1.png";
import sliderImg02 from "../../Multi/slider2.png";
import sliderImg03 from "../../Multi/slider3.png";

export const sliderData = [
  {
    id: "01",
    title: "Tenemos comida sencilla y deliciosa para ti.",
    desc: "Nuestra selección de recetas está elaborada con ingredientes frescos y de calidad, inspirada en la cocina casera que nos llena de nostalgia. Ya sea que estés buscando un almuerzo rápido, una cena reconfortante o un snack delicioso, tenemos algo especial para ti. Disfruta de sabores tradicionales y creativos que hacen que cada comida sea memorable.",
    imgUrl: sliderImg01,
  },
  {
    id: "02",
    title: "Nosotros creemos la buena comida",
    desc: "Ven y descubre por qué creemos en la buena comida. Te invitamos a disfrutar de platos que evocan recuerdos y crean nuevos momentos especiales. Porque aquí, cada comida es una celebración de lo delicioso.",
    imgUrl: sliderImg02,
  },
  {
    id: "03",
    title: "Conoce, come y haz la prueba",
    desc: "haz la prueba; Estamos seguros de que una vez que pruebes nuestros platillos, querrás regresar por más. Ven y descubre por qué creemos en la buena comida y cómo cada bocado puede hacer la diferencia.",
    imgUrl: sliderImg03,
  },
];
export default sliderData;
